import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for any "Your Profile" link using a unique XPath (to avoid previous selector strategies)
    // We'll look for the *last* "Your Profile" link on the page
    const profileLinkXPath = '(//a[normalize-space(text())="Your Profile"])[last()]';
    await page.waitForSelector(`xpath=${profileLinkXPath}`, { timeout: 5000 });

    // Highlight the link for screenshot (simulate hover/focus)
    const profileLink = await page.$(`xpath=${profileLinkXPath}`);
    await profileLink.hover();

    // Screenshot after hover
    const step2 = path.join(screenshotsDir, 'step_2_hover_profile.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile to load by waiting for a unique element (Jun's name in profile header)
    // Use a CSS selector for the profile header containing "Jun Kim"
    await page.waitForSelector('.profile-header >> text=Jun Kim', { timeout: 5000 });

    // Screenshot of Jun's profile page
    const step3 = path.join(screenshotsDir, 'step_3_jun_profile.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract Jun's profile name and bio for verification
    const profileName = await page.textContent('.profile-header .profile-info h2');
    const profileBio = await page.textContent('.profile-header .profile-info .bio');

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile information.",
      extractedData: {
        profileName: profileName ? profileName.trim() : null,
        profileBio: profileBio ? profileBio.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
